import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div id="Navbar">
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/stock">Stock Tracker</Link>
          </li>
        </ul>
    </div>
  );
};

export default Navbar;
